(1503, 133, 'page__secciones_0_page__secciones__texto', 'Viña La Junta reúne a la familia, los amigos, y a todos esos seres queridos con los que buscas compartir, celebrar o simplemente pasarlo bien.\r\n\r\nLas tradiciones como ramadas, corridas de caballos, rodeo y chinchineros eran parte de nuestros veranos en el fundo Los Pocillos, San Clemente, 7ª Región. Veranos llenos de sol y de vida al aire libre marcaron nuestra juventud, acompañados de decenas de primos, tíos, padres y abuelos.\r\n\r\nTiempos en que aprendimos la labor de los campesinos que se encargaban de sacar lo mejor de la tierra, ricos quesos de la lechería y aromáticas uvas de los viñedos.\r\n\r\nCada día íbamos a la bodega de barricas y fudres, jugábamos, nos escondíamos etc. Fue asi, como sin querer, fuimos aprendiendo el proceso de transformación de las uvas en vino. Creo que esos recuerdos, el legado familiar y la pasión por la naturaleza es lo que nos ha unido en lo que hoy es en La Junta. Viva Chile!!'),
