(1528, 250, '_page__secciones_0_page__secciones__titulo', 'field_5bd474af4b632'),
(1529, 250, 'page__secciones_0_page__secciones__texto', '<div class="section__content__left column">\r\n<div class="section__content__left__text">\r\n\r\nRecepción\r\n\r\nLuego de la cosecha manual, la fruta llega a la bodega en\r\nbins (450kg)o gamelas (15 kg) dependiendo de la calidad y\r\ntipo de proceso de recepción (uso o no de mesa de selección)\r\n\r\n&nbsp;\r\n\r\nMolienda\r\n\r\nEl proceso se inicia con un sistema de recepción móvil que\r\npermite ser instalado frente al tanque que se va a cargar.\r\nLa uva es volteada suavemente sobre una mesa de selección\r\nque en forma manual permite eliminar impurezas\r\ncomo Hojas, sarmientos, racimos enfermos y elementos extraños.\r\n\r\nPosterior a ello la fruta sube a través de una cinta elevadora\r\npara luego ser despalillada, separando las bayas de los escobajos.\r\n\r\nLa fruta ingresa directamente a la cuba por gravedad, para\r\nentrar a una maceración fría de 5 a 10 dias.\r\n\r\n&nbsp;\r\n\r\nFermentación\r\n\r\n</div>\r\n</div>'),
