(1840, 259, '_page__secciones_0_page__secciones__imagen', 'field_5bd474af4ae81'),
(1841, 259, 'page__secciones_0_page__secciones__titulo', 'VINIFICACIÓN'),
(1842, 259, '_page__secciones_0_page__secciones__titulo', 'field_5bd474af4b632'),
(1843, 259, 'page__secciones_0_page__secciones__texto', 'Recepción\r\nLuego de la cosecha manual, la fruta llega a la bodega en bins (450kg)o gamelas (15 kg) dependiendo de la calidad y tipo de proceso de recepción (uso o no de mesa de selección)\r\n\r\nMolienda\r\nEl proceso se inicia con un sistema de recepción móvil que permite ser instalado frente al tanque que se va a cargar.\r\nLa uva es volteada suavemente sobre una mesa de selección que en forma manual permite eliminar impurezas como Hojas, sarmientos, racimos enfermos y elementos extraños.\r\nPosterior a ello la fruta sube a través de una cinta elevadora para luego ser despalillada, separando las bayas de los escobajos.\r\nLa fruta ingresa directamente a la cuba por gravedad, para entrar a una maceración fría de 5 a 10 dias.'),
